supportingDocuments.purpose.ProofOfIndiv:
Any documents proving the residence of the individual can be accepted if they are dated less than 3 months old and include the name and address of the individual. 
Acceptable documents:
- Documents related to the home (rental contract, mortgage statement, etc.);
- Home utility bills (for electricity, telephone, Internet services, gas, water, etc.);
- Payroll (if it includes the worker's address).

supportingDocuments.purpose.UltimateBene:
Include one document for each person who owns at least 25% of the capital/rights to vote, or any person who controls your company's executive bodies or management.

Acceptable documents:
- Any documents proving the residence of the individual can be accepted if they are dated less than 3 months old and include the name and address of the individual. These documents can be:
- Documents related to the home (rental contract, mortgage statement, etc.);
- Home utility bills (for electricity, telephone, Internet services, gas, water, etc.);
Payroll (if it includes the worker's address)."
